      console.log(`Notification job created: ${job.id}`);
    } else {
      console.error('Failed to create job:', err);
    }
  });

job.on('complete', () => {
  console.log('Notification job completed');
});

job.on('failed', (errorMessage) => {
  console.log(`Notification job failed: ${errorMessage}`);
});

